import "./App.css";
import Footer from "./components/Footer";
import Header from "./components/Header";
import SideBar from "./components/SideBar";
import Terms_Of_User from "./components/Terms_Of_User";

function App() {
  return (
    <div>
      <div className="A">
        <div className="A-1">
          <SideBar />
        </div>&nbsp;&nbsp;
        <div className="A-2">
         <Header />
         <hr id="hr3" />
        </div> 
      </div>
      <Terms_Of_User/>
      <hr id="hr" />
      <div className="A-3">
      <Footer  />
      </div>

    </div>
  );
}

export default App;
